import logo from './logo.svg';
import './App.css';
import { MainPage } from './containers/MainPage/MainPage'; // Update the import path

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
<MainPage></MainPage>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <MainPage></MainPage>
    </div>
  );
}

export default App;
